(55, '2 M 5 M > 9 > j M 2 H > SD > j M 2 H > 9 > j L L S > j 214 S ~ M > 236 L M ', '', '', NULL, 20, '2019-03-21 01:40:50', 5042, 6, NULL, '1.15', NULL, ''),
(56, '2 M 5 M > 9 > j M L L > j 2 H > S H > j M L L > j 2 H > 9 > j L L S > j 214 M > 236 L M ', '', '', NULL, 20, '2019-03-21 01:41:53', 4992, 6, NULL, '1.15', NULL, ''),
(57, '2 M 5 M > 9 > j M 2 H > S H > j M 2 H > 9 > j L L S > j 214 M > Vanish > 66 > L > L > L > S H > j M 2 H > 9 > j L L L ', '', '', NULL, 20, '2019-03-21 01:44:02', 5195, 3, NULL, '1.14', NULL, ''),
(58, '2 M 5 M > j M [2hit] >  214 M >  empty vanish > j M [1hit] > 66 j L > j M [land] > j L L [2hit] > j 2 H > j L > j M [2hit] > j 2 H > j L L [2hit] > 214 M ', 'bardock rejump in spark for big damage. Note: can\'t do 5LL in the combo, has to be 2L>2M or 5L>2M in confirms.', 'https://streamable.com/s/gn1lu/hzvhuk', NULL, 26, '2019-03-21 06:18:33', 5853, 6, NULL, NULL, NULL, ''),
(61, '2 LK > 2 MK > HP > MP HK > HP ~ 236 MK -> HK ~ j. LK > j. MK > j. HK > 2 LK > 2 MK > HK ~ j. LP > j. MK > j. HK > LP > LP > MP > 2 HP ~ 236 HP ', 'Works on all characters and probably works with a lot of other assists too. You can spend 1 bar after 236MK for more damage by using daisy pusher, and you can add battle opera at the end and do a spaced 2HP for a burst bait.', 'https://youtu.be/zMijEjxyca8', NULL, 149, '2019-03-21 14:11:43', 7403, 31, NULL, NULL, NULL, ''),
(62, 'j. MK > d MP > MP > qcf K > P > qcf K > d P', 'Standard combo from cross-up j.mk.', '', NULL, 46, '2019-03-21 14:32:20', 0, 7, NULL, '', '', ''),
(63, 'B > C > 3 C > 623 A > 623 B > 2 B > 236 [ B ] > B > 6 C > 236 A > 6 A > 6 A ', 'Corner combo. Works off 5C > 5C > 3C as well.', '', NULL, 202, '2019-03-21 16:56:35', 3405, 47, NULL, '', '', ''),
(64, '2 A > B > C > 3 C > 623 B > 2 B > 236 [ B ] > B > 6 C > 236 A > 6 A > 6 A ', 'Corner combo of a bad starter (2A, 5A, 2AA etc).', '', NULL, 202, '2019-03-21 17:01:35', 2985, 47, NULL, '', '', ''),
(65, '2 M 5 M > 2 9 > j M H > 236 M > j 2 H > 9 > j L L L S > SD > j L L L S > 236 M > [ Vanish ] > 214 M > A1 > [ DR ] > 236 [ L M ] ', 'Works from round start to corner', '', NULL, 28, '2019-03-21 18:37:46', 6916, 6, NULL, NULL, NULL, ''),
(66, '2 M 5 M > 9 > j M H 2 H > S H > j M H 2 H > 9 > j L L L S > j 214 S > dl M H > [ L M ] ', 'Corner', '', NULL, 20, '2019-03-21 21:04:21', 5111, 6, NULL, '1.15', NULL, ''),
(67, '2 M 5 M > 9 > j M H 2 H > S H > j M H 2 H > 9 > j L L L S > j 214 M > 236 L M ', 'Corner', '', NULL, 20, '2019-03-21 22:05:59', 5419, 6, NULL, '1.15', NULL, ''),
(68, '2 M > dl 5 M > 5 H > S H > j M 2 H > 9 > j L L S > j 214 M ', '', '', NULL, 20, '2019-03-21 22:10:20', 3870, 6, NULL, '1.15', NULL, ''),
(69, '2 M 5 H 5 S > 236 S > spark > dl 66 > j [ H A2 ] > (land) > 5 H 5 S 2 S > 2 9 > j L L L S > SD > j L L L 2 H > 9 > j L L L S > 236 L > 236 [ L M ] > dl A2 > A1 > [ H S ] (Hold)', 'Mid is Tohan for this combo, but honestly anyone will work, some members of the cast can kill without the last 2 bars. Needs corner.\r\nGoku assist is optional but makes timing the j.H into 5H much easier. Basically, this is a universal corner ToD route for Vegito, any assist will work here.', '', NULL, 28, '2019-03-22 06:15:23', 11082, 6, NULL, NULL, NULL, ''),
(70, '2 M > 5 S > 2 S > 7 (Hold) > j L L L 2 H > j L L L S > SD > j L L L S > 236 M > [ Vanish ] > 214 M > 236 [ L M ] ', 'Solo, works only when you are the one in the corner', '', NULL, 28, '2019-03-22 06:20:10', 6425, 6, NULL, NULL, NULL, ''),
(71, '2 M > 5 S > 2 S > 2 7 (Link) > j L L L 2 H > j L L L S > SD > j L L L S > 236 M > [ Vanish ] > 214 M > A2 > [ DR ] > 236 [ L M ] ', 'Recorner combo, only works when you are the one in the corner', '', NULL, 28, '2019-03-22 06:23:17', 6794, 6, NULL, NULL, NULL, ''),
(72, '2 M > 2 L > 5 L L > 9 > j M L L S > SD > j L L 2 H > 9 > j L M L S > 236 M > 236 [ L M ] ', 'Universal BnB, works anywhere on the screen', '', NULL, 28, '2019-03-22 06:26:45', 5335, 6, NULL, NULL, NULL, ''),
(73, '2 M > 2 L > 5 L L > 9 > j M L L S > SD > j L L 2 H > 9 > j L M L S > 236 M > [ Vanish ] > 214 M ', 'Corner to corner', '', NULL, 28, '2019-03-22 06:30:32', 4887, 6, NULL, NULL, NULL, ''),
(74, '2 M > 5 S > 214 S > spark > (land) > 5 S > 6 H > 236 M L L > A1 > 6 H > 236 M L L > A2 > 236 L M > 2 S > [ DR ] > 236 L M > A1 > 4 A2', 'Corner only ToD. Dhc\'s can be in any order', '', NULL, 33, '2019-03-22 13:09:06', 10000, 6, NULL, NULL, NULL, ''),
