(893, '2 M ~ 5 H ~ 2 H ~ H S >  j L L ~ 9 ~ j L L ~ j 2 H > dl 214 L ~ M H > 214 L > L > 236 M ', 'Metered Midscreen BNB. Switches sides. \r\nCan be started with j.H, 5L, 2L, 5M, and 2H for less damage, or 5LL for more damage. \r\nFor extra damage, replace j.LL ~ j.LL with j.MLL ~ 9 > dl. j.LL. \r\nFor super, replace the final Medium Gale Claw with L and a super of your choice.\r\nThe more hits the combo has before 2H, the tighter the timing is on the delayed Light Gale Claw.', 'https://youtu.be/-PCP4dzJ8ck', NULL, 9, '2020-02-13 21:01:29', 4564, 6, NULL, '1.16', '', ''),
(894, '2L 5LL 2M 5S 236M 2M 5S SD jM jH 5LL 2L sj jM(2) jL j5S SD jLL j2S j2H', 'Corner only, works on every character, 0 bar start', 'https://www.youtube.com/watch?v=6UDyVmjGgFU', NULL, 34, '2020-02-14 16:36:22', 5369, 6, NULL, '1.20', NULL, ''),
