(903, 'L  L  A1 + L ~ 236 H > 6 > L -> L  L  A1 + L ~ 236 H > dl 6 > L', 'Corner Left/Right 50/50. Most assists can be used, assuming they have enough blockstun.\r\nThe goal is an ambiguous jL, but you can land and do whatever with enough conditioning.\r\nYou can hold 4 to fly farther out of the corner, or take the top route and press 4 at the last second for a last-minute cross-up.', 'https://twitter.com/SkeezerMui/status/1219336417060511746?s=20', NULL, 11, '2020-02-14 20:17:20', 0, 1, NULL, '1.20', NULL, ''),
