(909, 'j H (land) > L L M M S > 214 S > dl 2 M S H > SD > j L M 2 H > 9 > j L L S > 214 L > S > 236 L ', 'Meterless Corner BNB with SKD\r\nDamage varies depending on starter\r\nThe S~flip~S~slash cancels are kinda fast, so don\'t hold those for too long', 'https://youtu.be/vmqJc6cRtG0', NULL, 11, '2020-02-14 20:43:15', 4082, 3, NULL, '1.20', NULL, ''),
(910, 'L L 5 M 5 S 2 S H + S  j M j S (Spark) (land) 66 5 S 2 S 2 9 j L L 2 H j M j H 236 L [ M H ] j S 236 L 214 L M', 'After spark, be sure to give yourself enough time to land or else you will end up doing JS. Works anywhere on screen. \r\nCONFIRM THAT 5L PUNISH YOUR OPPONENT YOSHAA', 'https://youtu.be/VbOyx6yTMfI', NULL, 28, '2020-02-14 21:01:33', 5854, 6, NULL, '1.20', 'Deleto_FGC', ''),
