(916, 'j H > 5 L 5 L 5 M > 8 j S > j 2 L > 2 M 5 M > 2 8 > j M L L S > 236 M > SD > j M L > j 2 H > 8 j L L S S S S S > > 214 M', 'Corner only. 2.1 bars gained. Safejump after.', 'https://twitter.com/kalopsia4u/status/1228445346663034880?s=20', NULL, 4, '2020-02-14 22:47:02', 4002, 6, NULL, '1.20', 'Kalopsia', ''),
(917, 'j M L > 5 L L > 2 M > 2 S > 5 S 5 H > SD > j M H > j 214 L > j L L > 9 j M L L 2 H > j S S S S > j 236 L ', 'Universal corner combo that doesn\'t involve loops as it uses the post-smash j214L > jL link. It still provides good damage and meter gain (which varies depending on assist used to extend). This combo done without assists results in post-buttstomp oki (6M allows 5L to confirm on hit, safe jump IAD jM, & other meaty options). ', 'https://twitter.com/MbuuVirtual/status/1229718862628712448?s=20', NULL, 22, '2020-02-14 22:55:13', 3645, 6, NULL, '1.20', NULL, ''),
(918, '236 H > 9 66 j M L > 2 L > 5 L L > dl L ', 'From low to medium hit stun combos that result in a character in fat-throw state, you are able to do auto combo grab reset/mix/oki(also known as auto combo tick throw). This scenario can also be seen as a type of \"oki\" situation as there is a true RPS happening right after 5LL. Your options are as follows: 5LLL (tick throw), 5LL (empty), 5LL 2M / 214M (frame trap). These options, for the most part, cover every single defensive option. What makes this \"oki\" very strong is that the tick throw hard counters block and reflect (the two most common defensive choices). Lastly, the scaling from the tick throw (as of 1.20) is very favorable. There have been 1 bar TODs found through this setup. What is demonstrated above is a double overhead into auto combo tick throw performed solo with assisted follow ups. ', 'https://www.youtube.com/watch?v=RmTySukIDCw', NULL, 22, '2020-02-14 23:29:45', 1990, 6, NULL, '1.20', 'Alioune', ''),
(919, '5 M 2 M 6 H 5 H > dl > SD > j 66 > j M (land) > 66 > 9 > j L M > 9 > j L L S 214 L (whiff) > j L L S > SD > j L L S > dl j 236 M', 'Universal\r\nCan be done from midscreen to corner, remove one air normal to account for SD travel time', 'https://twitter.com/_palmtop/status/1228458992415821826?s=20', NULL, 17, '2020-02-14 23:30:16', 5120, 6, NULL, '1.20', NULL, ''),
(920, '214 [ L ] > L M > j M L L ', 'Double overhead is difficult to get. Loop by comboing after explosion into j2h -> plant -> assist -> snap.', 'https://twitter.com/kalopsia4u/status/1228460606077816832?s=20', NULL, 14, '2020-02-14 23:35:51', 0, 2, NULL, '1.20', 'Kalopsia', ''),
(921, 'DR A1 > 5 L (whiff) > 9 > j M S > SD > A1 j 66 L L -> DR A1 > 5 L (whiff) > 9 > j M S > SD > A1 (land) 2 L L', 'j M S SD can be OS\'d into a combo if they take the hit on incoming', 'https://twitter.com/_palmtop/status/1228459053258436608?s=20', NULL, 17, '2020-02-14 23:50:14', 0, 2, NULL, '1.20', NULL, ''),
(922, '2 M 5 M > 9 j M (1) S 236 M > dl j 66 M (1) S > (land) 5 L L > IAD j L S > (land) 5 L dl L 2 M 5 M 5 H > SD > j L L 2 H > j L L > 214 L', 'max realistic solo damage skd, no j.H > 5L loops, no 5H > 5L link', 'https://twitter.com/_palmtop/status/1228459102147268609?s=20', NULL, 26, '2020-02-15 00:04:51', 5040, 6, NULL, '1.20', NULL, ''),
