(941, '2 M 5 M > j M L L > j 2 H > H + S > j M S > j L dl L > j S > j L dl L > j S > j L dl L > j S > j L L 2 H > j L L L ', 'Universal Corner Air Loop BNB. 3 loops with a j.2H extension, 4 without. Slight delay in between  j. L L  in order to manipulate height for loops.', 'https://www.youtube.com/watch?v=up4bs9uMeVg', NULL, 30, '2020-02-15 04:18:21', 4957, 6, NULL, '1.20', NULL, ''),
