(943, '2 L > 5 L L > j H > dl 5 L L > 5 M > sj L L L > j 5 S > j 2 S > H + S > j L L > dj L L > 236 L M M ', 'Universal 2L Corner BNB. You may have to delay the intial 5 L L depending on the character size, but it still connects on every character.', 'https://youtu.be/G47sXyr8Las', NULL, 525, '2020-02-15 04:45:43', 4197, 6, NULL, '1.20', NULL, ''),
