(948, '2 M 5 M > j M > j 236 L L M > j S > (land) > 2 M 5 H 2 S > SD > j L L 2 H > 9 j L L S 2 S > j 214 L', 'Max damage Corner combo (2M starter)', 'https://twitter.com/Afrodo98/status/1137324529896833025', NULL, 5, '2020-02-15 07:54:54', 4987, 6, NULL, '1.20', '', ''),
(949, '5 M > A1 > 236 M > 2 L', 'Beerus\' Assist covers the gap before and after 236M (not reflectable)', 'https://twitter.com/RinSenpaiii/status/1113068063077908481', NULL, 5, '2020-02-15 08:01:17', 0, 1, NULL, '1.20', '', ''),
(950, '236 ( L ) > 6 L / M > spark  > 236 S > 2 L > 2 H > SD  > j M H > 9 >  j M H > j 2 H > A1 > 9 > j M   H > 9 > j M  H > j 214 L > A2 > j DR  > 236 L + M > 7 L 9 L 7 L 9 L > 4 A2 > 7 L ', 'Works with almost any  Pre S3 assist, though some may not kill due to the difference in damage between them (namely krillin\'s rock.). For a non Goku route, add an extra 0.75 bar.', 'https://www.youtube.com/watch?v=yaoH_odxhww', NULL, 9, '2020-02-15 08:51:29', 10012, 6, NULL, '1.20', NULL, ''),
(951, '236 L M > 9 4 6 7 1 > 236 M ', 'Any Combination that results in at least 30 frames of frame advantage & 1 or 2 input allows this fake crossup to work. Catches all non-delay tech options and can react to a delay tech via further buttons.', 'https://www.youtube.com/watch?v=xXycE37MXWQ', NULL, 9, '2020-02-15 09:07:04', 0, 4, NULL, '1.20', 'Skaihigh#6932', ''),
(952, '2 M 5 M > j L L ( 2 ) > j 2 H > SD > j L L ( 2 ) > j 2 H > j L L ( 2 ) > 214 L ', 'Midscreen bnb, can be used anywhere.', 'https://youtu.be/uutDwleH9y4', NULL, 13, '2020-02-15 09:11:17', 4050, 6, NULL, '1.20', '', ''),
(953, '5 L > 2 L > 5 M 2 M 5 H > A1 > 2 L > 2 L > 2 M 5 M ', 'As of 1.20, you want to finish piccolo\'s blockstring with 5M atleast because it is safe on block. Any other normal moves after that will require assist protection/extension after that. All other special moves other than 6S (which can still be reflected) are extremely unsafe to finish on and can get you punished.', 'https://youtu.be/8Py2gJGVjhI', NULL, 13, '2020-02-15 09:39:55', 0, 1, NULL, '1.20', '', ''),
