(1038, '5 L L > 5 M > 5 H > 2 H > 214 S', '214S almost all the time at the end of a blockstring to keep yourself at a safe distance and to bait out reflects/buttons, not shown in the video is 214S 236M/H~X which keeps you safe from all options meterless except for grabs due to the full invincibility on frame 18 for M and frame 4 for H. The options shown in the video are some of Hit\'s best and safest options', 'https://www.youtube.com/watch?v=JqRk6I61NxE', NULL, 23, '2020-02-18 12:12:30', 0, 1, NULL, '1.20', NULL, ''),
