(1069, '2 M 5 M > 9 > j M 2 H > j S > SD > j M L > 9 > j L L S 214 L (whiff) > j L L S 214 L (whiff) > j L L S > dl j 236 M', 'Recommended 2M starter corner route\r\nUniversal, remove last loop for non 2M starter, can add jLL before j2H on scaled starters to compensate for meter gain\r\nMax meter gain from 2M starter', 'https://twitter.com/_palmtop/status/1229998290122313728', NULL, 17, '2020-02-19 21:01:30', 4895, 6, NULL, '1.20', NULL, ''),
(1070, '2 M 5 M > 9 > j M 2 H > 9 > j M S > dl > SD > j L L S 214 L (whiff) > j L L S 214 L (whiff) > j L L S > dl j 236 M', 'Not recommended due to j2H 9 jM link and multiple delays, only resulting in minimal damage improvement\r\nUniversal, delay before SD mandatory for height\r\nMax damage from 2M starter (not meter gain)', 'https://twitter.com/_palmtop/status/1229998343943704576', NULL, 17, '2020-02-19 21:06:21', 4945, 6, NULL, '1.20', NULL, ''),
