(1088, '214 M > spark > 66 > 6 H dl 5 H 2 S (2) > j 66 > j M > (land) 5 H 2 S (2) > j 66 > j M > (land) 5 H 5 S (2) > 9 > j L L S > 66 > j S > SD > j L M 214 M > dl > Vanish > (land) DR > 236 S > 214 L + M', 'Universal, corner only', 'https://twitter.com/_palmtop/status/1230001005149818881', NULL, 17, '2020-02-19 22:40:32', 8923, 6, NULL, '1.20', NULL, ''),
(1089, '214 L > spark > 2 M dl 6 H 2 S (2) > dl j 66 > j M > (land) 6 H 2 S (2) > dl j 66 > j M > (land) 6 H 2 S (2) > dl j 66 > j M > (land) 6 H 2 H > SD > j M > 9 > j M H > (land) 214 L + M', 'Universal for first loop, becomes MUCH HARDER MIDSCREEN on small bodies afterwards\r\nMust airdash lower for midscreen 2S loops so 6H can connect afterwards\r\nCan go into low j2H (land) ground extension if you reach the corner sooner', 'https://twitter.com/_palmtop/status/1230001093083455488', NULL, 17, '2020-02-19 22:46:23', 7445, 6, NULL, '1.20', NULL, ''),
