INSERT INTO `combo` (`idcombo`, `combo`, `comments`, `video`, `user_iduser`, `character_idcharacter`, `submited`, `damage`, `type`, `verified`, `patch`, `author`, `password`) VALUES
(1097, 'SD > j M 2 H > (land) 9 > j L L > 9 > j L L S 214 L (whiff) > j L L S > SD > j L L 2 H > j 236 M', 'Universal, can get more damage from unrealistic SD j2H starter', 'https://twitter.com/_palmtop/status/1230062824442875904', NULL, 17, '2020-02-19 23:04:33', 3335, 6, NULL, '1.20', NULL, ''),
(1098, '236 S > [ Vanish ] j 66 > j M > (land) 5L > 9 > j M L L 2 H > SD > j L L > 9 > j M L L H S > j 236 M', 'Universal, other routes/conversions exist', 'https://twitter.com/_palmtop/status/1230062879837052928', NULL, 17, '2020-02-19 23:08:41', 4597, 6, NULL, '1.20', NULL, ''),
(1099, '214 H > spark > 2 M dl 6 H 2 S (2) > dl j 66 > j M > (land) 6 H 2 S (2) > dl j 66 > j M > (land) 5 H 2 S (2) > j 66 > j M > (land) 5 H 5 S (5) 214 L > 214 L + M', 'Universal for first loop, becomes MUCH HARDER MIDSCREEN on small bodies afterwards\r\nFinal loop can be done midscreen with 6H if needed for corner carry', 'https://twitter.com/_palmtop/status/1230062955976216577', NULL, 17, '2020-02-19 23:17:26', 7799, 6, NULL, '1.20', NULL, ''),
(1100, '214 H > spark > 2 M dl 6 H 2 S (2) > dl j 66 > j M > (land) 6 H 2 S (2) > dl j 66 > j M > (land) 5 H > 9 > j M S > j 66 > j M S > SD > j L L 214 M > dl > Vanish > (land) DR > 236 S > 214 L + M', 'Universal for first loop, becomes MUCH HARDER MIDSCREEN on small bodies afterwards', 'https://twitter.com/_palmtop/status/1230063044060798977', NULL, 17, '2020-02-19 23:21:41', 8551, 6, NULL, '1.20', NULL, ''),
(1101, '2 M 5 M > 9 > j M H S > SD > j M L L > 9 > j L L L S 2 H ', '2 enders can be used for this route depending on desired effect\r\n1) j2H - required for the best oki, as well as ending with supers (without ultimate z change) midscreen\r\n2) j214M - slightly more meter gain, worse oki. Can\'t end in supers solo. Best ender if using an assist to combo into Spirit Bomb\r\n\r\njS can be added before either ender if the combo ends up in the corner for extra damage/meter gain.\r\n\r\nNotation for alternate routes:\r\n2 M 5 M > 9 > j M H S > SD > j M L L > 9 > j L L L S > j 214 M     [Corner ender] (4464 1.25 bar)\r\n2 M 5 M > 9 > j M H S > SD > j M L L > 9 > j L L 2 H                     [Midscreen ender] (4115 0.9 bar)\r\n2 M 5 M > 9 > j M H S > SD > j M L L > 9 > j L L L > j 214 M        [Midscreen ender] (4302 1.1 bar)', 'https://www.youtube.com/watch?v=HCXScIGe6O4', NULL, 479, '2020-02-19 23:34:08', 4489, 6, NULL, '1.20', NULL, ''),
(1102, '5 L L 5 M M 5 H 2 S > 214 L > A1 > j 66 > j M ', 'Corner only 50/50 off GT\'s normal blockstring with an assist. Works with any assist 20f blockstun and up, but is very tight below 23f. \r\n5 L L 5 M M 5 H 2 S > 214 L > A1 ->\r\nOption 1) late airdash jM\r\nOption 2) land 2m\r\nThese options work against the whole cast. About half the cast can get hit by land 2L. \r\nLinked tweet shows who gets hit by this: https://twitter.com/RinSenpaiii/status/1126538375283007488?s=20', 'https://www.youtube.com/watch?v=x0N2rjG5wfM', NULL, 479, '2020-02-20 00:36:09', 0, 1, NULL, '1.20', NULL, ''),
(1103, '2L 5LL 2M 5S 236M 2L 5L sj jM(2)LL 7jM j2S dl jLL(2) jS SD jLL j2S j2H', '2L starter BnB for the corner, works on every character', 'https://twitter.com/Mephis03110066/status/1091661680243822592', NULL, 34, '2020-02-20 01:57:11', 5267, 6, NULL, '1.20', NULL, ''),
(1104, '2L 5LL 2M 5S 236M 2M 5S SD jM jH 5LL 2L sj jM(2) jL j5S SD jLL j2S j2H', 'Optimal 2L starter combo in the corner, works on every character', 'https://www.youtube.com/watch?v=6UDyVmjGgFU', NULL, 34, '2020-02-20 01:58:51', 5369, 6, NULL, '1.20', NULL, ''),
(1105, '2M 5M jM 7.jM j2S jL j5S 236M 2M 5M jc jL jM(2) 7.jM j2S jLL j2 SD jLL j2S j2H', '2M starter BnB combo, works on every character', 'https://twitter.com/tatsunical/status/1171239223564701696', NULL, 34, '2020-02-20 01:59:52', 4971, 6, NULL, '1.20', NULL, ''),
(1106, '2M 5M 236M 2M 5S SD jM dl jH 5LL dl 2M 5S 2S SD jM(2) jL (2) jc jLL j2S j2H', 'Optimal 2M starter corner combo, works on every character', 'https://youtu.be/Belyk2gI1eA', NULL, 34, '2020-02-20 02:00:46', 5201, 6, NULL, '1.20', NULL, ''),
(1107, '2 L L 5 M 2 M 5 H > SD > 214 L > A1 > 236 H S > H S > SD > M > j L L > 9 DR ', 'almost full corner carry, with any other assist its full corner carry. Can go into ghost ahki after the combo', 'https://www.youtube.com/watch?v=YfsT6WzNJxM', NULL, 12, '2020-02-20 03:06:28', 3565, 6, NULL, '1.20', NULL, ''),
(1108, '2 M 5 M > jM > jH > j2H > SD > jM > jH > j2H > jLLLS > 214M >  SSJ A1 > 5LLL > SD > jM > j2H > jLL > 236S-M > 236LM', 'Beginner corner combo for Android 21, optimized for damage.', 'https://youtu.be/VwoePGztnGk', NULL, 20, '2020-02-20 04:00:01', 6521, 6, NULL, '1.20', NULL, ''),
(1109, '5M > 2M > 5H > delay SD > 66 > jM > (land) > 669 > jLLL > j2H > jLLS > 214M > DBS Broly A1 > 6 > 5LLL > SD > jM > j2H > jLL > 236S-M > 236LM', 'Rejump combo with DBS Broly assist A', 'https://youtu.be/-z6TFz7jlsM', NULL, 20, '2020-02-20 04:12:12', 6164, 6, NULL, '1.20', NULL, ''),
(1110, '5M > 2M > 236S (smash) > (land) > 66 > 214S > SD > jM > jL > jc > jM >jL > j2H > jS > 236M > 236LM', 'Advanced midscreen/fullscreen route for DBS Broly', 'https://youtu.be/mtKlVgcQ2xk', NULL, 526, '2020-02-20 04:22:55', 5680, 6, NULL, '1.20', NULL, ''),
(1111, '2 M 5 M > 236M > 2 M 5 M > jM > jM > delay j.L > SD > j.L > delay j.H > 2L > 5M > jM > jM > jL > jS > SD > jM > j2H > jS > 236M > 236LM', 'Advanced corner route for DBS Broly', 'https://youtu.be/p8B1iGg3Yfc', NULL, 526, '2020-02-20 04:30:10', 6839, 6, NULL, '1.20', NULL, ''),
(1112, '5 M 2 M > 214 M > dl 2 M 5 S 5 H > 236 S > A1 > 214 S > 236 H S > 2 9 j L L j 2 H > j L L L > DR ', 'You can go into ghost after the DR', 'https://www.youtube.com/watch?v=NhCCGlrgyXA', NULL, 12, '2020-02-20 04:59:31', 6139, 6, NULL, '1.21', NULL, ''),
(1113, '2 M 5 M > j M S > j 2 1 4 M > dl. j S > (land) 6 6 2 M 5 H 5 S > SD > j M L 2 H > 9 > j L L S > j 2 3 6 M', 'Universal. On non-small characters, you don\'t have to do a delay jS into dash up 2M. You can just land and hit 2M dl. 5M 5H 5S > SD. It\'s also better to jump back into the jMS > j214M if you\'re smack in the corner.', 'https://youtu.be/JGHU--YO1zQ?t=191', NULL, 3, '2020-02-20 18:26:33', 5027, 6, NULL, '1.20', NULL, ''),
(1114, '2 M 5 M > 9 > j M > 9 > j M H > j 236 M > j 214 S ~ 7 S 3 S > j L L L S > j 214 M ', 'Corner only. Alternate ender of j2h shown in video for better oki, same damage/meter gain.', 'https://www.youtube.com/watch?v=uErZGBQem84', NULL, 479, '2020-02-22 01:21:27', 4799, 6, NULL, '1.20', NULL, ''),
(1115, '2 H > SD > j M L L > 9 > j L L L > j 214 M ', 'Midscreen solo. If jLLL ends at the corner, jS can be added before j214M/j2h ender.\r\nAlternate ender:\r\n2 H > SD > j M L L > 9 > j L L 2 H\r\n2980 damage, 0.75 bar gain, better oki', 'https://www.youtube.com/watch?v=Lq7gN_4vvR4', NULL, 479, '2020-02-22 01:29:46', 3205, 6, NULL, '1.20', NULL, ''),
(1116, '2 M 5 H > 214 S ~ 3 S 3 S 1 S > SD > j M L L > 9 > j L L L S > j 214 M ', 'Very useful confirm if 5H connects in the corner. As usual for corner routes, j2h is an alternate ender:\r\n2 M 5 H > 214 S ~ 3 S 3 S 1 S > SD > j M L L > 9 > j L L L S 2 H\r\n4259 damage, 1.25 bar build', 'https://www.youtube.com/watch?v=69MThbqBhxc', NULL, 479, '2020-02-22 01:37:15', 4234, 6, NULL, '1.20', NULL, ''),
(1117, '5 M 2 M > 236 M > 2 M 5 S 5 H > SD > 66 j H > (land) > 8 > j L M L > 8 > j L L L S > j 214 M ', 'Most useful as a reflect/GC punish, or when you need to confirm off a 5m2m hit. Light/overhead starters usually need to omit the 66 jH rejump and the jS at the end, due to hitstun decay (especially if trying to work assists into the combo).\r\nAlternate j2h ender\r\n5 M 2 M > 236 M > 2 M 5 S 5 H > SD > 66 j H > (land) > 8 > j L M L > 8 > j L L L S 2 H', 'https://www.youtube.com/watch?v=0IQf5wtyN7s', NULL, 479, '2020-02-22 01:43:11', 5005, 6, NULL, '1.20', NULL, ''),
(1118, 'xx j 2 H > (land) > 44 > 9 > dl j H ', 'From any route ending with j2H in the corner, this works to cover all techs/wakeups that aren\'t delayed stand. Counter hits 2h, safe jumps invincible reversals. Backdash and hold 9 can be buffered, but jH has to be timed slightly after the apex of the jump. Video shows the oki setup vs various wakeup options including dash out.', 'https://www.youtube.com/watch?v=89-TtF4pbU4', NULL, 479, '2020-02-22 01:50:02', 0, 4, NULL, '1.20', NULL, ''),
(1119, '2 M 5 M > 9 > j M L L > 9 > j L L S > j 214 S ~ dl 7 S 3 S > j L L L > j 214 M ', 'Reverse kamehameha will put you at the corner as long as you are facing the corner at around round start. If j214s route does not put you in the corner, you will not be able to do the jLLL follow-up, and must do j236L + assist to adjust.', 'https://www.youtube.com/watch?v=ECWlUz4NOQQ', NULL, 479, '2020-02-22 01:56:13', 4287, 6, NULL, '1.20', NULL, ''),
(1120, '2 M 5 M > 9 > j M > 9 > j M S > j 214 S ~ 7 S 3 S > j 236 L > A1 > SD > j M L L > 9 > j L L L > j 214 M ', 'Example routing for j214S -> j236L. Higher hitstun grounded assists can allow for non-SD follow-ups, depending on screen position.', 'https://www.youtube.com/watch?v=RWc_1F1K8L8', NULL, 479, '2020-02-22 02:01:58', 4937, 6, NULL, '1.20', NULL, ''),
(1121, '5 L L L > L > j L L L > j 214 S ~ 7 S 3 S > j M > 9 > j L L L S > j 214 M ', 'For usage when challenging with your back to the corner.\r\nFirst route is easier, and builds more damage and meter (1.5 bar) than the second, but doesn\'t cause a slide knockdown. Assists are needed for oki/genkidama extension.\r\n\r\nAlternate, harder route with less damage but solo SKD (j2h ender also available here):\r\n5 L L L > 214 S ~ 7 S 3 S > j M > 9 > j L L L S > j 214 M \r\n3352 damage, 1.2 bar build', 'https://www.youtube.com/watch?v=bR9tcMsDeck', NULL, 479, '2020-02-22 02:13:23', 3514, 6, NULL, '1.20', NULL, ''),
(1122, '2 M 5 H > 236 S > spark > (land) > 66 > 2 M 5 H > 9 > j H S > j 66 H > (land) > 5 L 5 H 5 S > 9 > j H S > j 66 H > (land) > 5 L L L > 236 S ~ [ 7 ] 3 S > 236 H + S > j 66 DR [ L ] ', '(notation for reverse kame + spirit bomb is as if you never changed sides, for more clarity)\r\nSolo corner 2m spark route into spirit bomb for meter dumping. Very applicable if you either:\r\n1) have 3+ bar solo and want to kill a character\r\n2) just used your last assist to get a mixup into this starter and therefore can\'t use it for a better sparking route', 'https://www.youtube.com/watch?v=dHRx6opDyeo', NULL, 479, '2020-02-22 02:29:16', 8363, 6, NULL, '1.20', NULL, ''),
(1123, '2 H > spark > (land) > 66 > 2 M 5 S 5 H > 9 > j H S > j 66 H > (land) > 5 L 5 H 5 S > 9 > j H S > j 66 M H > (land) > 9 > j L L L > 9 > j L L L > j 214 M > (land) >  214 L + M ', 'Solo 2H spark routing. Altered route needed for 5LLL -> spirit bomb.\r\nAlso doable with your back to the corner, simply 2H, Spark, dash out of the corner, and continue the combo as normal. Also applicable if opponent Guard Cancels on your 5LL (as a multi hitting move, you can cancel out of any hit into 2H).', 'https://www.youtube.com/watch?v=-WVOt8da710', NULL, 479, '2020-02-22 02:44:26', 7975, 6, NULL, '1.20', NULL, ''),
(1124, '2 M 5 M > 9 > j M > 9 > j M H S > j 214 S ~ dl 7 S 3 S > j L L L S 2H', 'Alternative to using j236M for reverse kamehameha routes. This is often better for double assist routes and non-2m starters, but worse for single assist or solo routes.\r\nj 214 M ender shown, for slightly less damage.', 'https://www.youtube.com/watch?v=N4NCm3x9jao', NULL, 479, '2020-02-22 02:48:59', 4719, 6, NULL, '1.20', NULL, ''),
(1125, 'xx > 2 S > A1 > dl j 2 S ', 'Midscreen left/right mixup using 2s to get into the air, followed by j1/2/3s to hit on the left or right side. Many assists work for this, as long it has decent blockstun (~25+?) but not too much. In order for the crossup to not be affected by crossup protection from the assist\'s blockstun, the opponent must be out of blockstun by the time the j1/2/3s connects.\r\n\r\nConverts on hit:\r\n1) Same side:\r\nj 2 S > 236 H > 66 5 L L 5 M > 9 > j M L L > 9 > j L L 2 H\r\n2) Cross up:\r\nj 2 S > 214 S ~ 4 S 6 S > 236 H > 66 5 L L 5 M > 9 > j M L L > 9 > j L L 2 H\r\n\r\nIf you end up in the corner, j L L L S 2 H / j L L L S 214 M enders are possible.', 'https://www.youtube.com/watch?v=iLc_zM1HROU&feature=youtu.be', NULL, 479, '2020-02-22 03:13:15', 0, 1, NULL, '1.20', NULL, ''),
(1126, '5 L L 5 M 2 M 5 H A1 2 S j 3 S > j 66 L ', 'High/low 50/50 that works midscreen or in the corner with kid buu assist, but only in the corner with gotenks assist. Kid buu assist shown.\r\nAirdash jL for high, land 2L for low.', 'https://www.youtube.com/watch?v=AkmYg05FiEk', NULL, 479, '2020-02-22 03:22:35', 0, 1, NULL, '1.20', NULL, ''),
(1127, '2 M 5 M > 9 > j M > 9 > j M H S > j 214 S ~ dl 7 S 3 S > j L L L > j 214 M > dl A1 > (land) > 66 5 L L L > 236 S ~ [ 7 ] 3 S > 236 H + S > j 66 DR [ L ]', '(notation for reverse kame + spirit bomb is as if you never changed sides, for more clarity)\r\nVery common corner route for using an assist to combo into 5 L L L -> reverse kamehameha -> spirit bomb. Reverse kamehameha routes that end low to the ground make these easier, and are required for some assists.', 'https://www.youtube.com/watch?v=mKulPVu-zt4', NULL, 479, '2020-02-22 03:29:23', 7366, 6, NULL, '1.20', NULL, ''),
(1128, '2 M 5 M > 9 > j M > 9 > j M H > A1 > j 214 M > j 214 S ~ 7 S 3 S > j H > j 236 M > (land) > dl 5 L L L > 236 S ~ [ 7 ] 3 S > 236 H + S', '(notation for reverse kame + spirit bomb is as if you never changed sides, for more clarity)\r\nAlternate corner route for some unusual assists that can\'t otherwise enable 5 L L L spirit bomb routes. For the shown Kid Buu A assist, press A1 with jH. Remember, reverse kamehameha\'s first hit does not require an additional S input, simply holding 7 after the initial 214s input will cause the first reverse kame to come out in the correct direction ASAP.', 'https://www.youtube.com/watch?v=N2J4HzPogNQ', NULL, 479, '2020-02-22 03:37:31', 7079, 6, NULL, '1.20', NULL, ''),
(1129, '2 M 5 M > 9 > j M dl L L > 9 > j L L L S > SD > j L L L S > j 214 M', 'Difficult side swap route. Use the rhythm in the video to learn the timing. Often best off using the 5LLL routes.', 'https://twitter.com/True_Tech/status/1135761749762748416?s=20', NULL, 479, '2020-02-22 03:42:58', 4299, 6, NULL, '1.20', NULL, ''),
(1130, '5 L L 5 M + A1 5 H dl 214 L  \r\n\r\n->  5 L L 5 M 2 M A2 5H dl 214 L ', 'Corner only. For multi hit assist call during the 5M. For quick single hit assist call during the 5H. Delay 214L to make sure the enemy is no longe rin blockstun. Time assist call properly can range from being -13 to +1 on block.', 'https://www.youtube.com/watch?v=UHagz2mZvCE', NULL, 2, '2020-02-22 18:39:30', 0, 1, NULL, '1.20', NULL, ''),
(1131, 'SD > j M dl 2 H (land) SD > j L M 2 H > 9 j L M > 236 M', '', 'https://twitter.com/fruitspunches/status/1231305561364484098', NULL, 33, '2020-02-22 19:55:59', 2497, 6, NULL, '1.20', NULL, ''),
(1132, 'IAD j H (land) > 5 L L 5 M 2 M > 214 S > 2 M dl 5 M 5 H 5 S > 214 L > j S > SD > j M 2 H > 9 > j L L S > 214 L > j S > 236 L ', 'Optimal corner combo. The delay 5M only needs to be done on a select few characters; Bardock, Adult Gohan, Yamcha, Gogeta, and Majin Buu (and maybe a few others, I\'m not sure entirely) and it\'s a good habit to just always do the delay 5M so you don\'t have to consciously do the delay sometimes. ', 'https://twitter.com/bucoy_michael/status/1231340868189159430?s=19', NULL, 11, '2020-02-22 20:19:48', 4187, 6, NULL, '1.20', NULL, ''),
(1133, 'IAD j H (land) > 5 L L 2 M 5 M > 9 > j M L L 2H > SD > j M L L 2H > 9 > j L L S > 214 H > j M H (land) > 214 L+M', 'The combo route for landing level 3 midscreen. After knocking them down after H flip, you\'ll land on the opposite side.', 'https://twitter.com/bucoy_michael/status/1231341323116064768?s=19', NULL, 11, '2020-02-22 20:50:53', 5582, 6, NULL, '1.20', NULL, ''),
(1134, '5 L L 2 M 5M > 9 > j M L L 2 H > 214 L > SD > j M L L 2 H > 9 > j L L L ', 'Main solo side switch combo.', 'https://twitter.com/bucoy_michael/status/1231341797240164355?s=19', NULL, 11, '2020-02-22 21:08:15', 3367, 6, NULL, '1.20', NULL, ''),
(1135, '2 M 5 M 3 H > 2 9 > j M L L 2 H > SD > j M L L > 9 >  j L L L ', 'Agohan Midscreen bnb lvl 0', 'https://www.youtube.com/watch?v=juA-vSn1sPc', NULL, 7, '2020-02-22 21:31:13', 4387, 6, NULL, '1.20', NULL, ''),
(1136, '5 M 2 M 5 S 3 H > 9 > j L H > j 236 L > (Land) 5 L (Cancel in the first hit) > 9 > j L M H > j 236 L > (Land) 5 L 3 H > 9 > j M 2 H > SD > j M 2 H > 9 > j L L L ', 'Agohan Corner bnb lvl 0', 'https://www.youtube.com/watch?v=A2iR5PkCoUg', NULL, 7, '2020-02-22 21:41:08', 5381, 6, NULL, '1.20', NULL, ''),
