(1143, '2 M 5 M 1 H > 2 7 > j M L L 2 H > SD > j M L L > 7 > j L dl L > j 214 M [Hold back] > j 2 H > j 236 L ', 'Agohan Midscreen bnb lvl 1\r\n\r\n--In order to do the J legs combos you need to press the M one time. Dont hold', 'https://www.youtube.com/watch?v=Y3rabZN11yU', NULL, 7, '2020-02-22 22:11:37', 4599, 6, NULL, '1.20', NULL, ''),
