(1145, '5 M 2 M 5 S 2 S > SD > 4 4 H > j 214 L > (Land) 5 L 1 H > 2 7 > j M L L 2 H > SD > j M 2 H > 7 > j L L L ', 'Agohan Corner bnb lvl 1', 'https://www.youtube.com/watch?v=Pi7AxWVpcPo', NULL, 7, '2020-02-22 22:17:21', 0, 6, NULL, '1.20', NULL, ''),
