(1147, 'IAD J H > 5 L L > 2 M 5 M > 9 j M H > 236 M > 5 S > SD > 5 L L L > 2 H > 9 L L L > 5 S > 236 L > Vanish > 214 M', 'Corner universal after IAD jH. Only difference from regular corner BnB is that you have to use the Spirit Sword -> SD before the 2H double jump due to the higher hitstun decay with the extra attack.', '', NULL, 28, '2020-02-22 22:24:36', 4409, 6, NULL, '1.20', NULL, ''),
