(1154, 'IAD j H (land) > 5 L L 5 M 2 M 5 H > dl SD > 66 j M (land) > 66 9 j L L 2 H > 9 > j L M L S > 214 L > j S > 236 L', 'Midscreen to corner 5H rejump combo. Can work with 2M 5M 5H as well, you just have to delay SD a bit more if you do. Does more damage than the universal midscreen BnB. ', 'https://twitter.com/bucoy_michael/status/1231353041984589824?s=19', NULL, 532, '2020-02-22 23:04:05', 3865, 6, NULL, '1.20', NULL, ''),
