(1168, 'j H (land) > 5 L L 5 M 2 M 5 H > dl SD > 66 j M (land) > 66 9 j L L 2 H > j L M L S > 214 L > j S > 236 L', 'Midscreen to corner 5H rejump combo. Can work with 2M 5M 5H as well, but you\'d have to delay SD a bit more if you do. Does more damage than universal midscreen BnB. ', 'https://twitter.com/bucoy_michael/status/1231353041984589824?s=19', NULL, 11, '2020-02-23 04:38:46', 3865, 6, NULL, '1.20', NULL, ''),
(1169, '2M > dl 5M > sjM > j[6]S > jL(1)L > j2H > SD > jML(3) > j2H > jc > jL(3)LL', 'Universal Midscreen sjM > j[6]S BnB', 'https://www.youtube.com/watch?v=MRpKf7ZDwxQ', NULL, 12, '2020-02-23 09:49:11', 4432, 6, NULL, '1.20', NULL, ''),
(1170, '2 M 5 M > sjL(2) > j[6]S > jL(1)L > j2H > SD > jML(3) > j2H > jc > jL(3)LL', 'Universal Midscreen sjL(2) > j[6]S BnB. Can be done with jL(3) but jL(2) is for max damage off a 2M starter. On scaled start jL(2) and jL(3) have a difference of 2 damage. This is actually less damage than Gotenks\' regular BnB off 2M start but is still more meter overall. This does more damage than his universal when comboed from a scaled starter.', 'https://www.youtube.com/watch?v=M8cFEETtT-o', NULL, 12, '2020-02-23 10:00:41', 4012, 6, NULL, '1.20', NULL, ''),
(1171, '2 M 5 M > jM > j2H > SD > jML(3) > j2H > jc > jL(3)LL', 'Staple basic BnB for Gotenks. Can be done with jML(3) at start instead of jM to get a little extra damage and meter on scaled starters. ', '', NULL, 12, '2020-02-23 10:22:34', 4185, 6, NULL, '1.20', NULL, ''),
(1172, 'Far B > C > 6 C > 66 > 2 C > 6 B > 2 C > C > dl. 6 C > 214 B ', 'Keep in mind that this is an UNIST combo, it might not work when UNICLR comes out.', 'https://www.youtube.com/watch?v=7t8IacsF6kQ&feature=youtu.be', NULL, 199, '2020-02-23 11:04:36', 3114, 47, NULL, 'UNIST', NULL, ''),
