(1233, '2 M > 5 H > 214 L > A1 > 2 M > 5 M (4) > 5 S S S S S S > 5 H > H + S > j L L (2) > j 2H > j L L (2) > j S S S S > j 236 S', 'Corner only. For braindead hit confirms. Works with any bounce assist like Beerus ( B ) or 21 ( B ), can be modified depending on the assist for more or less damage. 236L can be remplaced by 214L.', 'https://twitter.com/PillarNote/status/1232772537819549703', NULL, 530, '2020-02-26 21:33:51', 5231, 6, NULL, '1.21', NULL, ''),
(1234, '5 M (4) > 2 M > 214 M > 2 M > 5 H > 236 L > A1 > 2 M > 5M (4) > 5 H > H + S > j L L (2) 2H > j L L S S S S > j 236 S', 'Corner only. 5M starter version. Works with any bounce assist like Beerus ( B ) or 21 ( B ), can be modified depending on the assist for more or less damage. 236L can be remplaced by 214L.', 'https://twitter.com/PillarNote/status/1232772715704090626', NULL, 530, '2020-02-26 22:13:20', 5775, 6, NULL, '1.21', NULL, ''),
(1235, '6 H > 214 L > A1 > 2 M > 214 M > 2 M > 5 M (4) > 5 S S S S S S > 5 H > H + S > J L L (2) 2H > j L L (2) > j S S S S > j 236 S', '6H starter corner BNB, using a bounce assist. Lower damage. 236L can be remplaced by 214L.', 'https://twitter.com/PillarNote/status/1232772817193701378', NULL, 530, '2020-02-26 22:19:28', 3669, 6, NULL, '1.21', NULL, ''),
(1236, '6 H > 214 M > 2 M > 5 H > 236 L > A1 > 2 M > 5 M (4) > 5 S S S S S S > 5 H > H + S > J L L (2) 2H > J L L S S S S > J 236 S', 'Corner only. Max damage version. Works with any bounce assist like Beerus ( B ) or 21 ( B ), can be modified depending on the assist for more or less damage. 236L can be remplaced by 214L', 'https://twitter.com/PillarNote/status/1232772904619855873', NULL, 530, '2020-02-26 22:24:11', 4054, 6, NULL, '1.21', NULL, ''),
(1237, '236 H > H + S > J M (2) L > j L L (2) L > A1 > 5 M (4) > j L L(2) 2H > H + S > J L L (2) L', 'Works everywhere. The bounce allows to connect 5M, but I guess other assists like pop ups could allow to connect at least jL. Closer from your opponent after 236H, you get to link 2M with bounce assists. Works after 5H, but you need to do J 236S at the end. Don\'t go for j.236S as an ender most of the time, it\'s more safe this way for HSD. Causes SKD.', 'https://twitter.com/PillarNote/status/1232773091476090880', NULL, 530, '2020-02-26 22:37:42', 4038, 6, NULL, '1.21', NULL, ''),
(1238, '236 H > 66 Jump > j L L (2) > j L L(2) L > A1 > 2 M > 5 M (4) > j L L (2) 2H > H + S > J L L (2) 2H > J L L (2) L', 'No SD version ', 'https://twitter.com/PillarNote/status/1232773468715966466', NULL, 530, '2020-02-26 23:09:39', 4143, 6, NULL, '1.21', NULL, ''),
(1239, '5 L L > 5 M (4) > 2 M > 214 L > A1 > 2 M > 5 M (4) > j M (2) L 2 H > H + S > J L L (2) 2 H > J L L (2) L', 'Midscreen combo with assist, using a ground bounce assist.\r\nFirst version. Some bounce assist have enough hitstun to jump behind and side switch ( example : Blue Vegeta B ).\r\nSensible to hitstun decay, don\'t hesitate to leave hits out if you aren\'t confident.', 'https://twitter.com/PillarNote/status/1232773675910418432', NULL, 530, '2020-02-26 23:14:19', 3743, 6, NULL, '1.21', NULL, ''),
(1240, '5 L L > 2 M > 5 M (4 ) > j M (2) L > j L L (2) L > A1 > 2M > 5 M (4) > j M (2) 2 H > H + S > J M ( 2 ) 2 H > j L L (2) L ', 'Midscreen combo with ground bounce assist, V2. \r\nHighly sensible to hitstun decay, more so than V1. Don\'t hesitate to leave out hits the more scaled your starter is. ', 'https://twitter.com/PillarNote/status/1232773783242596369', NULL, 530, '2020-02-26 23:17:49', 3747, 6, NULL, '1.21', NULL, ''),
(1241, '5 L L > 2 M > 5 M (4) > j M (2) L > j L L (2) L > A1 > 6 H > 2 H > H + S > J L L (2) 2 H > J L L (2) L', 'Version 3 of the midscreen combo with ground bouce assist. This might be exclusive to Blue Vegeta\'s B assist due to the amount of hitstun it has. Also allows to side switch by doing 66 6H, 2H. ', 'https://twitter.com/PillarNote/status/1232773867225206788', NULL, 530, '2020-02-26 23:21:58', 3652, 6, NULL, '1.21', NULL, ''),
(1242, '5 L L > 2 M > 5 M (4) > j M (2) L > J L L (2) L > A1 > 66 J L L(2) 2 H > H + S > J L L (2) 2 H > J L L (2) L', 'Version 4 of the midscreen combo with ground bounce assist, showcasing the possible side switch ( another is possible with 66 6H, 2H ). Might be exclusive to higher hitstun like Blue Vegeta\'s B assist. ', 'https://twitter.com/PillarNote/status/1232773939966795776', NULL, 530, '2020-02-26 23:25:24', 3670, 6, NULL, '1.21', NULL, ''),
(1243, 'J H > 2 M > 214 M > 66 2 M > 5 H > 236 L > A1 > 2 M > 5 M (4) > 5 H > H + S > J L L (2) 2 H > J L L (2) S S S S > J 236 S', 'J.H starter, max damage with assist causing ground bounces. Corner only. \r\nWORKS FOR J.M ( second hit ) STARTER ! 4401 DAMAGE.', 'https://twitter.com/PillarNote/status/1232774031725731841', NULL, 530, '2020-02-26 23:31:44', 4751, 6, NULL, '1.21', NULL, ''),
(1244, 'J M (2, one whiff) > 2 L > 2 L > 2 M > 214 M > 66 2 M > 5 H > 236 L > A1 > 2 M > 5 S S S S S S > 5 H > H + S > J L L (2) 2H > j L L (2) S S S S > J 236 S', 'More confirmable version of the combo for j.M ( second hit ) starter with less damage. Corner only. Works with any ground bounce assist.', 'https://twitter.com/PillarNote/status/1232774209199316992', NULL, 530, '2020-02-26 23:40:34', 4027, 6, NULL, '1.21', NULL, ''),
(1245, '6 H > 5 S > 5 H > H + S > J M (2) > j L L (2) L > A1 >2 M > 5 M (4) > j L L (2) 2 H > J L L (2) > j 236 S', 'BNB with ground bounce assists. \r\nFor corner carry. Might not be optimized at all.', 'https://twitter.com/PillarNote/status/1232774382679994369', NULL, 530, '2020-02-26 23:43:45', 3159, 6, NULL, '1.21', NULL, ''),
(1246, 'J M (second hit) / J H > 2 L > 5 L L > 5 M (1) > 2 M > 214 M > 66 2 M > 5 M (4) > 5 S S S S S S > 5 H > H + S > J L L (2) 2 H > J L L (2) S S S S > J 236 S ', 'Meter building solo corner combo from j.H / j.M ( second hit only ) starter. Version 1 ( less damage ). \r\nCombos using one 5LL can remplace it with a 5M (4), and vice versa. ( not true for combos that need both ). ', 'https://twitter.com/PillarNote/status/1232751523052085248', NULL, 530, '2020-02-26 23:51:49', 3454, 6, NULL, '1.21', NULL, '');
INSERT INTO `combo` (`idcombo`, `combo`, `comments`, `video`, `user_iduser`, `character_idcharacter`, `submited`, `damage`, `type`, `verified`, `patch`, `author`, `password`) VALUES
(1247, 'j M ( second hit ) > 66 2 L > 5 L > 5 M (4) > 2 M > 214 M > 66 2 M > 5 M (4) > 5 S S S S S S > 5 H > H + S > J L L (2) 2 H > J L L S S S S > J 236 S', 'Meter building corner combo from J.H or J.M ( second hit ) starter.\r\nHarder to do since you have to 66 right after the air normal for extra meter ( without this one, you virtually get 2 bars, but not quite ), will give the opponent more time to block if he blocked the overhead and didn\'t block low immediatly. Leaving just one 5L can rise the damage by 100, up to close to 3.9k, at the cost of a little meter.', 'https://twitter.com/PillarNote/status/1232749169871376384', NULL, 530, '2020-02-26 23:58:45', 3661, 6, NULL, '1.21', NULL, ''),
(1248, '236M with an assist call after, during or before depending of the start up > AD j.L / AD j.M / 2L / 2M.', 'Using Blue Vegeta\'s 236M ( or alternatively, 236LM or MM if 236M hits in neutral ) with low pushback assists to get a 50/50 midscreen !\r\n4 timings, with the grab as a bonus.\r\nAs a tip, don\'t use 236M after 5H. Do it randomly in your blockstring. Your opponent cannot react to it fast enough to reflect. \r\nThe assists that allow it are Adult Gohan ( B ), Videl ( B ), Kefla ( B ), Jiren ( A ), Nappa ( B ), Tenshinhan ( B ), Kid Buu ( A ), Gotenks ( A, too inconsistant for 236M, easier for 236LM ), Bardock ( B, a bit hard for 236M, way easier for 236LM ), probably some C assists as well. \r\nThe minimum amount of blockstun is 21f ! Anything more allows to add layers ( empty fall, IAD ect ... ). ', 'https://twitter.com/PillarNote/status/1232859209001324544', NULL, 5, '2020-02-27 02:49:51', 0, 1, NULL, '1.21', NULL, ''),
(1249, '2 M 5 H > dl SD > j 6 6 > j L M [ 1 ] > (land) 6 6 9 > j L M [  2  ] > dl j 9 > j L M [ 2 ] j S S S S Vanish > SD > j L M [ 2 ] 236 S > j 236 H S ', 'Out of Corner Rejump into side switch. Can end combo with j236S after jSSSS instead to save bar and keep corner positioning.', 'https://twitter.com/ItsInigma/status/1232810880246669314?s=20', NULL, 530, '2020-02-27 04:17:20', 5148, 6, NULL, '1.21', NULL, ''),
(1250, '5 M 2 M 5 L L > 9 > j M dl H dl L > (land) 5 L > 9 > j M dl H dl L > (land) 5 L 5 H > SD > j M L > j 9 > j L L > j 236 S > Vanish > 66 > 236 L > 214 L + M ', 'Corner', 'https://youtu.be/X1VXvpLwZqg', NULL, 16, '2020-02-27 19:12:43', 8114, 6, NULL, '1.21', NULL, ''),
(1251, '1 M 5 M > 9 > j M (1) > j 236 H > ( Vanish ) > [ 4 ] > 5 M > 9 > j M (1) > j 236 H > ( Vanish ) > [ 4 ] > 5 M > 9 > j M (1) > j 236 H > ( Vanish ) > [ 4 ] > 5 M > 9 > j M (1) > j 236 H > ( Vanish ) > 214 L > 236 L + M ', 'Corner', 'https://youtu.be/E6f4ouUUHt4', NULL, 21, '2020-02-27 19:15:41', 5870, 6, NULL, '1.21', NULL, ''),
(1252, '1 M 5 M > 9 > j M (1) > j 236 H > ( Vanish ) > 214 H > 66 > 5 L L L > SD > j L M (1) L 2 H > j 9 > j L L S > j 236 H > Vanish > 236 S > 214 L + M ', '', 'https://youtu.be/v0rHxUiDvtA', NULL, 21, '2020-02-27 19:18:43', 7317, 6, NULL, '1.21', NULL, '');
