INSERT INTO `logs` (`idlog`, `Description`, `Date`) VALUES
(1, 'Added patch option to combos.', '2019-03-23'),
(2, 'Added number formatting.', '2019-03-23'),
(3, 'Added 44 and 66 global buttons.', '2019-03-23'),
(4, 'Added Them\'s Fightin\' Herds.', '2019-03-23'),
(5, 'Fixed type selection on edit that would always be set up as a combo when trying to edit an entry.', '2019-03-23'),
(6, 'Changed Combo好き\'s logo to a less bad one. (ctrl+F5 to make sure you have the new logo)', '2019-03-23'),
(7, 'Added Under Night In-Birth Exe:Late.', '2019-03-24'),
(8, 'Added author textarea to submissions.', '2019-03-31'),
(9, 'Added combo passwords, now you can only edit combos if you know their password.\r\nThanks to madninjaman for the suggestion.', '2019-03-31'),
(10, 'Combos can now be deleted.', '2019-04-04'),
(11, 'Fixed how combos were displayed in the game and search pages on mobile.', '2019-04-06'),
(12, 'Shortened link length of a specific combo.', '2019-04-06'),
(13, 'Created 2 cookies to handle background color and combo display preferences.', '2019-04-08'),
(14, 'Now the combo\'s comments appear as a tooltip on the combo\'s link on the game and search pages. Mobile feature in the near future.', '2019-04-10'),
(15, 'Added primary resources and whether it is a combo/blockstring/mix up/archive to the quick search', '2019-04-11'),
(16, 'Added profile page to assemble combos from a single author.', '2019-04-16'),
(17, 'Now you can look a combo\'s comments and video when it\'s being listed in a search.', '2019-04-16'),
(18, 'Added Mortal Kombat 11', '2019-04-18'),
(19, 'Added MK9, MKX and Inustice 2. Those games may be incomplete, so please report it here: <a href=\"https://goo.gl/forms/6Q8dVlNbdOyTMA4h2\">google form</a>.', '2019-04-20'),
(20, 'New \"5\" button, whiff and land images. Added Kaiouken secondary resources for DBFZ. Imgur is supported on the combo page but not when searching, it acts weird and sometimes it doesn\'t load properly ;-;.', '2019-04-26'),
(21, 'New listing feature! Still a lot to improve on that, but now you can list your favorite combos to look after later or to share! You can create your list <a href=\"http://combosuki.com/list.php\">here</a>.', '2019-05-14'),
(22, 'The combo page now displays the combo\'s ID to make it easier to add it to a list.', '2019-05-14'),
(23, 'Added List Search.', '2019-05-16'),
(24, 'Added okizeme listing option.', '2019-05-19'),
(25, 'Now combos in lists appear in different tables for each category.', '2019-05-19'),
(26, 'Now you can delete combos from lists.', '2019-05-23'),
(27, 'Added Ultra Fight Da! Kyanta 2', '2019-06-25'),
(28, 'Had some problems with the database, and since the backup is too old every 500+ combos in here are lost (Not that anyone was using them anyway). Now the website is fully operational again, starting from 0 combos. I\'ll make sure to have more recent back ups if a reasonable amount of combos are submited.', '2019-10-29'),
(30, 'And I\'m stupid, found the latest back up, all the combos are back :3.', '2019-11-12'),
(31, 'Added Gundam Wing Endless Duel', '2019-11-28'),
(32, 'Added pages to edit game, game characters and game resources.', '2019-12-23'),
(33, 'I\'ll probably delete games that have too few entries in the near future, so another person can moderate it when the add game feature is up.', '2019-12-23'),
(34, '<a href=\"http://combosuki.com/addgame.php\">Add game</a> is up.', '2019-12-23'),
(35, 'Added Moderation Password for games, that password can edit everything but the game\'s info and it also can\'t delete the game.', '2020-02-12'),
(36, 'Added edit links page, where related links can be added to the games.', '2020-02-13'),
(37, 'Added custom entry type, now each game can have it\'s own set of entry options.', '2020-02-14'),
(38, 'Search doesn\'t consider spaces anymore. So 2 M = 2M for example.', '2020-02-15'),
(39, 'Added current patch to edit game page, current patch will auto complete patch when submitting a new entry.', '2020-02-13'),
(40, 'Added a Lock/Unlock button to editgame page, if a game is locked, it\'s moderation password can only edit that game\'s entries and lists, not being able to edit anything on the edit pages.', '2020-02-14'),
(41, 'Added MassEdit option to edition, mass edit currently allows to swap strings and swap resources by their ID of multiple entries.', '2020-02-17'),
(42, 'New resource type Duplicated, duplicated resource is for a resource that is selected twice, for example assists on DBFZ. Allows for a better searching experience, allowing results to be either Assist A/Assist B or Assist B/Assist A.', '2020-02-17'),
(43, 'Added editlists page, there lists can be promoted and have their name/password edited. Lists with higher hierarchy have priority on search.', '2020-02-17'),
(44, 'Added chronological search to the advanced search page.', '2020-02-18');
